                <TileImg src={strainbox} alt='strain type'></TileImg>
                <StrainType>Sativa</StrainType>
                <StrainAbb>SLV</StrainAbb>
                <Strain>Silver Haze</Strain> */}


            </StrainDiv>
        </div>


    )
}
